import React from "react";

import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <>
      {/* By default NavLinks receive active class */}
      <NavLink to="/">About</NavLink>
      <NavLink to="/contact">Contact</NavLink>
    </>
  );
};

export default Navbar;
